import React, { Component } from 'react';

class Home extends Component {
    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="col-md-12">
                        <h3 className="text-center display-3">Home</h3>
                    </div>
                </div>
            </div>
        )
    }
}

export default Home;
